import './App.css';
import Inbox from './components/Inbox/Inbox';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {
  return(
    <div className='App'>
      <BrowserRouter>
        <Routes>
        <Route exact path="/" element={<Inbox />} ></Route>
        <Route exact path="/:id" element={<Inbox split={true}/>} ></Route>
        </Routes>
      </BrowserRouter>
    </div>
  )
}

export default App;
